import React from "react";
import Card from './Card';


const CardList = ({ pokedex }) => {
    return (
        <tbody>
            {
                pokedex.map((user,i) => {
                    return (
                        <Card 
                            key={i}
                            id={pokedex[i].id}
                            num={pokedex[i].num}
                            name={pokedex[i].name}
                            img={pokedex[i].img}
                            type={pokedex[i].type.join(', ')}

                            height={pokedex[i].height}
                            weight={pokedex[i].weight}
                            candy={pokedex[i].candy}
                            candyCount={pokedex[i].candy_count}

                            egg={pokedex[i].egg}
                            spawnChance={pokedex[i].spawn_chance}
                            avgSpawns={pokedex[i].avg_spawns}
                            spawnTime={pokedex[i].spawn_time}

                            multipliers={!pokedex[i].multipliers ? 'No Multipliers' : pokedex[i].multipliers.join(', ')}
                            weaknesses={pokedex[i].weaknesses.join(', ')}


                            nextEvolution={!pokedex[i].next_evolution.name ? 'Final evolution' : pokedex[i].next_evolution.name}

                    //         nextEvolution={!pokedex[i].next_evolution ? 
                    //             'No evolutions' : 
                    //             pokedex[i].next_evolution.map((user, i) => {
                    //                 return user.name;
                    //             })}
                        />
                    );
                })
            }
        </tbody>
    )
} 

export default CardList;
